import logo from "./logo.svg";
import "./App.css";
import { ExpenseTrackerApp } from "./components/ExpenseTrackerApp";
import "bootstrap/dist/css/bootstrap.min.css";

const formateDate = (dateAsString) => {
  const dateObj = new Date(dateAsString);
  const formattedDateAsString =
    dateObj.getDate +
    " / " +
    dateObj.getMonth +
    " / " +
    dateObj.getFullYear() +
    " / " +
    dateObj.getTimezoneOffset();

  return formattedDateAsString();
};

function App() {
  return <div className="App">{<ExpenseTrackerApp></ExpenseTrackerApp>}</div>;
}

export default App;
